import React from 'react'
import  {connect} from 'react-redux'
import {  Grid, Header, List } from "semantic-ui-react";

export class layout extends React.Component {
  constructor(props){
    super(props)
    
  }
  render() {

    //console.log(this.props.optimized)
    //if(!this.props.optimized)return null;
    return (
        <div id="layout">
        <div className="container">
             <h2>Layout</h2>
             <Grid>
          <Grid.Row>
            <Grid.Column>
              <Header>List</Header>
              <List>
                {this.props.optimized[0].map(el => {
                  return (
                    <List.Item  key={el.step1}>
                      <List.Content>
                        {el}
                      </List.Content>
                      <List.Content>{el.phone}</List.Content>
                    </List.Item>
                  );
                })}
              </List>
            </Grid.Column>
          </Grid.Row>
        </Grid>  
            <ul id="weekdays">
            <li className= "active">
              M  
            </li>
            <li>
              T  
            </li>
            <li>
              W
            </li>            
            <li>             
             T  
            </li>           
            <li>
            F
            </li>            
            <li>
            S 
            </li>            
            <li>
             S   
            </li> 

            </ul> 

            <div className="list-style">
                  
          </div>
        </div>
        
        <div id = "layout_img">
            
        </div>
        <a className = "layout_labels">LINE 1</a>
        <a className = "layout_labels">LINE 2</a>
        <a className = "layout_labels">LINE 3</a>
        <div id = "layout_img2">
            
        </div>
        <a className = "layout_labels">LINE 4</a>
        <a className = "layout_labels">LINE 5</a>
        <a className = "layout_labels">LINE 6</a>
      </div>
    )
  }
}

const mapStateToProps = (state) => {
  // console.log(state);
  return {
   optimized : state.optimized[0]
  };
};


export default connect(mapStateToProps,null) (layout)
